import React from "react";
import {ResponsiveContainer} from "recharts";
import Title from "./Title";


class Chart extends React.Component {
  render() {
    return  (
      <React.Fragment>
      <Title>Today</Title>
      <ResponsiveContainer></ResponsiveContainer>
    </React.Fragment>
    );
  };
}

export default Chart;
